import React from "react";

import { Text, Image, View, StyleSheet, ScrollView, Card } from "react-native";

const ItemTemplate = () => {
  return (
    <View style={styles.container}>
      <Image source={require("../images/swords")} />

      <Text>Hello</Text>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    flexDirection: "column",
    justifyContent: "space-around",
  },
});

export default ItemTemplate;
